function init(){function i(){n.style.height="auto";n.style.height=n.scrollHeight+"px"}function t(){window.setTimeout(i,0)}var n=document.getElementById("text");observe(n,"change",i);observe(n,"cut",t);observe(n,"paste",t);observe(n,"drop",t);observe(n,"keydown",t);n.focus();n.select();i()}function getURL(){var t=window.location.href,n;if(t.includes("location=")){for(n=t.search("location="),n+=9,n=t.substring(n);n.includes("+");)n=n.replace("+"," ");document.getElementById("myheader").innerHTML=n==""?"Showing all results":'Showing results for "'+n+'"'}else document.getElementById("myheader").innerHTML="Showing all results"}function updatePrice(){var r=new Date(document.getElementById("dateStart").value),u=new Date(document.getElementById("dateEnd").value),t=document.getElementById("price").innerHTML,i=(u-r)/864e5,n=i*t;isNaN(n)||(document.getElementById("calculation").innerHTML="S$"+t+" x "+i+" nights",document.getElementById("calctotal").innerHTML="S$"+n,document.getElementById("total").innerHTML="S$"+n,document.getElementById("line").style.display="block",document.getElementById("totalprice").style.display="block")}function resizelistingimg(){for(var t=document.getElementsByClassName("listingimg"),n=0;n<t.length;n++)t[n].clientHeight<200&&(t[n].style.height="200px")}function updateDate(){var n=new Date(document.getElementById("dateStart").value),t,i;t=n.getMonth()<10?"0"+n.getMonth():n.getMonth();i=n.getDate()<10?"0"+n.getDate():n.getDate();document.getElementById("dateEnd").setAttribute("min",n.getFullYear()+"-"+t+"-"+i)}function rating(n){var r=document.getElementsByClassName("reviewStar"),t,i;for(document.getElementById("ratingValue").value=n,t=0;t<n;t++)r[t].innerHTML="&#9733";for(i=n;i<5;i++)r[i].innerHTML="&#9734"}var observe=window.attachEvent?function(n,t,i){n.attachEvent("on"+t,i)}:function(n,t,i){n.addEventListener(t,i,!1)};